"""–¶–≤–µ—Ç–æ–≤–æ–π –º–∏–∫—à–µ—Ä üé®üå∂Ô∏è
–ö—Ä–∞—Å–Ω—ã–π, —Å–∏–Ω–∏–π –∏ –∂–µ–ª—Ç—ã–π –Ω–∞–∑—ã–≤–∞—é—Ç—Å—è –æ—Å–Ω–æ–≤–Ω—ã–º–∏ —Ü–≤–µ—Ç–∞–º–∏, –ø–æ—Ç–æ–º—É —á—Ç–æ –∏—Ö –Ω–µ–ª—å–∑—è –ø–æ–ª—É—á–∏—Ç—å –ø—É—Ç–µ–º —Å–º–µ—à–µ–Ω–∏—è –¥—Ä—É–≥–∏—Ö —Ü–≤–µ—Ç–æ–≤. –ü—Ä–∏ —Å–º–µ—à–∏–≤–∞–Ω–∏–∏ –¥–≤—É—Ö –æ—Å–Ω–æ–≤–Ω—ã—Ö —Ü–≤–µ—Ç–æ–≤ –ø–æ–ª—É—á–∞–µ—Ç—Å—è –≤—Ç–æ—Ä–∏—á–Ω—ã–π —Ü–≤–µ—Ç:

–µ—Å–ª–∏ —Å–º–µ—à–∞—Ç—å –∫—Ä–∞—Å–Ω—ã–π –∏ —Å–∏–Ω–∏–π, —Ç–æ –ø–æ–ª—É—á–∏—Ç—Å—è —Ñ–∏–æ–ª–µ—Ç–æ–≤—ã–π;
–µ—Å–ª–∏ —Å–º–µ—à–∞—Ç—å –∫—Ä–∞—Å–Ω—ã–π –∏ –∂–µ–ª—Ç—ã–π, —Ç–æ –ø–æ–ª—É—á–∏—Ç—Å—è –æ—Ä–∞–Ω–∂–µ–≤—ã–π;
–µ—Å–ª–∏ —Å–º–µ—à–∞—Ç—å —Å–∏–Ω–∏–π –∏ –∂–µ–ª—Ç—ã–π, —Ç–æ –ø–æ–ª—É—á–∏—Ç—Å—è –∑–µ–ª–µ–Ω—ã–π.
–ù–∞–ø–∏—à–∏—Ç–µ –ø—Ä–æ–≥—Ä–∞–º–º—É, –∫–æ—Ç–æ—Ä–∞—è —Å—á–∏—Ç—ã–≤–∞–µ—Ç –Ω–∞–∑–≤–∞–Ω–∏—è –¥–≤—É—Ö –æ—Å–Ω–æ–≤–Ω—ã—Ö —Ü–≤–µ—Ç–æ–≤ –¥–ª—è —Å–º–µ—à–∏–≤–∞–Ω–∏—è. –ï—Å–ª–∏ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –≤–≤–æ–¥–∏—Ç —á—Ç–æ-–Ω–∏–±—É–¥—å –ø–æ–º–∏–º–æ –Ω–∞–∑–≤–∞–Ω–∏–π ¬´–∫—Ä–∞—Å–Ω—ã–π¬ª, ¬´—Å–∏–Ω–∏–π¬ª –∏–ª–∏ ¬´–∂–µ–ª—Ç—ã–π¬ª, —Ç–æ –ø—Ä–æ–≥—Ä–∞–º–º–∞ –¥–æ–ª–∂–Ω–∞ –≤—ã–≤–µ—Å—Ç–∏ —Å–æ–æ–±—â–µ–Ω–∏–µ –æ–± –æ—à–∏–±–∫–µ. –í –ø—Ä–æ—Ç–∏–≤–Ω–æ–º —Å–ª—É—á–∞–µ –ø—Ä–æ–≥—Ä–∞–º–º–∞ –¥–æ–ª–∂–Ω–∞ –≤—ã–≤–µ—Å—Ç–∏ –Ω–∞–∑–≤–∞–Ω–∏–µ –≤—Ç–æ—Ä–∏—á–Ω–æ–≥–æ —Ü–≤–µ—Ç–∞, –∫–æ—Ç–æ—Ä—ã–π –ø–æ–ª—É—á–∏—Ç—Å—è –≤ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–µ."""

first_color, second_color = input(), input()

if first_color == '–∫—Ä–∞—Å–Ω—ã–π' and second_color == '—Å–∏–Ω–∏–π' or first_color == '—Å–∏–Ω–∏–π' and second_color == '–∫—Ä–∞—Å–Ω—ã–π':
    print('—Ñ–∏–æ–ª–µ—Ç–æ–≤—ã–π')
elif first_color == '–∫—Ä–∞—Å–Ω—ã–π' and second_color == '–∂–µ–ª—Ç—ã–π' or first_color == '–∂–µ–ª—Ç—ã–π' and second_color == '–∫—Ä–∞—Å–Ω—ã–π':
    print('–æ—Ä–∞–Ω–∂–µ–≤—ã–π')
elif first_color == '—Å–∏–Ω–∏–π' and second_color == '–∂–µ–ª—Ç—ã–π' or first_color == '–∂–µ–ª—Ç—ã–π' and second_color == '—Å–∏–Ω–∏–π':
    print('–∑–µ–ª–µ–Ω—ã–π')
elif (first_color == '—Å–∏–Ω–∏–π' or first_color == '–∫—Ä–∞—Å–Ω—ã–π' or first_color == '–∂–µ–ª—Ç—ã–π') and first_color == second_color:
    print(first_color)
else:
    print('–æ—à–∏–±–∫–∞ —Ü–≤–µ—Ç–∞')